import React from 'react';

const EmptyState = ({ onNavigate }) => {
  const handleButtonClick = () => {
    console.log('Botão clicado! Navegando para formulário...');
    onNavigate(); // Esta função deve mudar para a tela de formulário
  };

  return (
    <div className="empty-container">
      <div className="welcome-section">
        <h1>Bem-vindo, Raphael!</h1>
      </div>
      
      <div className="empty-message">
        <p><strong>Você não tem nenhum imóvel cadastrado.</strong></p>
        <p><strong>Que tal cadastrar agora?</strong></p>
      </div>

      <button className="register-button" onClick={handleButtonClick}>
        Cadastrar meu primeiro imóvel
      </button>
    </div>
  );
};

export default EmptyState;
